script: |
  super -f text -I q333.spq | sort > q333.out

inputs:
  - name: q333.spq
    data: |
      SELECT - col0 AS col0, - 40 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( + col1 ) IN ( - col2, + col0, + + col2 );
  - name: tab1

outputs:
  - name: q333.out
    data: |
      -51	-40
      -85	-40
      -91	-40
